    const dispatch = useDispatch()
    const { Title } = useParams();
    console.log(Title)
    const data = useSelector(state => state.SearchBarReducer.SearchBarData)
    console.log("data===>", data)
    useEffect(() => {

        SearchBarAction(dispatch, { category: [Title] })
    }, [Title, dispatch])

    return (
        <>

            <ProductView />
            <FilterPanel />
        </>
    )
}

export default Filter
